local_state varchar2(4),
local_zip varchar2(10),
perm_street1 varchar2(30),
perm_street2 varchar2(30),
perm_street3 varchar2(30),
perm_street4 varchar2(30),
perm_city varchar2(20),
perm_state varchar2(4),
perm_zip varchar2(10),
adv_street1 varchar2(40),
adv_street2 varchar2(40),
adv_street3 varchar2(40),
adv_city varchar2(30),
adv_state varchar2(2),
adv_zip varchar2(10));
commit;


