commit;

alter table temp_nick_grads add advance_id varchar2(10);
commit;

alter table temp_nick_grads add adv_foreign_cityzip varchar2(30);
commit;

update temp_nick_grads  t
set t.advance_id =
    (select i.id_number
       from ids   i
where i.ids_type_code = 'CID'
and i.other_id = t.id);
commit;

update temp_nick_grads t
set t.adv_street1 =
    (select d.p_street1 from a_dw_addresS_good  d
    where d.id_number = t.advance_id);
commit;

update temp_nick_grads t
set t.adv_street2 =
    (select d.p_street2 from a_dw_addresS_good  d
    where d.id_number = t.advance_id);
commit;

update temp_nick_grads t
